import React, { Component } from 'react'

export default class sublifecycle extends Component {
    constructor(props) {
      super(props)

      this.state = {
        makanan: 'soto',
      }
    }

    componentWillUnmount() {
        this.props.changeFood(this.state.makanan)
    }

  render() {
    return (
      <div>sublifecycle</div>
    )
  }
}
